          "name": "Living Now or for the Future, Great Moments Pay Dividends, & Stop Creating Needless Suffering",
          "shareUrl": "https://open.spotify.com/episode/2H9nT6XQyyoH6iJgpNgaKE",
          "date": "2023-07-14T06:00:00Z",
          "description": "In this episode some of things we talk about but aren't limited to are:Buying experiences and memory vs. thingsThe seasons of life and figuring out when it makes the most sense to pursue somethingWhy and how some of us are secretly addicted to negativityHow improvement isn't 100% progression every dayIf you're tuning in on Spotify, there is an exciting feature that allows you to actively engage with us. Share your thoughts, opinions, or questions in the Q&A section, and we'll personally read and publish them. Let's transform these episodes into dynamic conversations where your voice matters too. Make sure to add your valuable insights after each episode!Thanks to Tamron Americas for sponsoring this episode! You can check out their website below to see their full lineup of camera lenses or visit your nearest photo retailer to purchase their products:https://tamron-americas.com/Thanks to OnCore Golf for being this episode's partial sponsor!Check out their award winning perimeter weighted golf balls here:https://www.oncoregolf.com/shop-golf-balls/Use code TPM15 for 15% off any order!Make a donation via PayPal for any amount you feel is equal to the value you receive from our podcast episodes! Donations help with the fees related to hosting the show:https://paypal.me/podcasttpm?country.x=CA&locale.x=en_USBig shoutout to this week's #TPMartwork feature @dusty_unknown with his beautiful wildlife photograph of a moose calf peeking through the tall grass. The young ones sure are fun to watch and photograph! Congratulations Dustin! Be sure to check out more of his work and keep submitting to the hashtag for your chance to have your image featured and talked about on a future episode!Thanks for listening!Go get shooting, go get editing, and stay focused.@sethmacey@mantis_photography@thephotographermindsetSupport the show",
