          "description": "Lights! Cameras! Arachnids! And lizards and bees and beetles. Macro photography is like magic: curved glass gives an entirely new take on the world, from dust on a crickets brow to a curious mantid stare to the elegant symmetry of spider whiskers. Joseph Saunders is an Oklahoma-based wildlife photographer whose larger-than-life photos of bugs and reptiles will make you realize just how little we appreciate the creatures on our window sills and skittering up our porches. We talk shop about cameras, bug hunts, lenses, patience, Moth Week, BlackAFinSTEM, and also getting into nature with different mobility concerns. Alie is a shameless, rabid fan of Joseph and asked Patrons to help concoct an -ology to describe the art + science of his macro photography. Aperiology now exists to describe the tiny aperture used to keep these creatures in focus, and the huge world it opens up to us.2023 CALENDARS ARE FOR SALESupport Josephs photography on PatreonVisit Josephs website and follow him on Instagram and TwitterA donation went to the American Chronic Pain AssociationFor more links: alieward.com/ologies/aperiologySponsors of OlogiesTranscripts and bleeped episodesSmologies (short, classroom-safe) episodesBecome a patron of Ologies for as little as a buck a monthOlogiesMerch.com has hats, shirts, masks, totes!Follow @Ologies on Twitter and InstagramFollow @AlieWard on Twitter and InstagramSound editing by Jarrett Sleeper of MindJam Media & Steven Ray MorrisTranscripts by Emily White of The WordaryWebsite by Kelly R. DwyerTheme song by Nick Thorburn",
