          "shareUrl": "https://open.spotify.com/episode/5B0AQR0smOh05o7OwDP7fT",
          "date": "2023-07-06T07:00:00Z",
          "description": "In this episode, Dr. Will Cole is joined by cookbook author and founder of the popular recipe blog Half Baked Harvest, Tieghan Gerard. After spending her early years in the kitchen with her parents, she was inspired to create her own blog to bring easy, delicious, and healthy recipes into the homes of people across the world. She gives us a behind-the-scenes look at what it really takes to develop a recipe, how long a recipe should actually take to cook to keep our attention, and spills her top tips for getting the perfect, social media-worthy food pic. Plus, we discuss the pros and cons of social media and how anyone can cultivate having healthy boundaries - even as a content creator! For all links mentioned in this episode: www.drwillcole.com/podcastPlease note that this episode may contain paid endorsements and advertisements for products and services. Individuals on the show may have a direct or indirect financial interest in products or services referred to in this episode.Sponsors:CleanSimpleEats.com code WILLCOLE at checkout for 20% off your first orderDrinkkarma.com/willcole code willcole for 15% off your first orderNutrafol.com/scalp code WILLCOLE for $10 off your first scalp care orderzbiotics.com/willcole code WILLCOLE for 15% off your first order Talkspace.com/abw for $80 off your first monthProduced by Dear Media.See Privacy Policy at https://art19.com/privacy and California Privacy Notice at https://art19.com/privacy#do-not-sell-my-info.",
