          "id": "3weXhCW5Lmheuya3vMkS4n",
          "name": "55: I Hosted a Photography Retreat in Maui and It Changed My Life! (Recap + Top 5 Lessons Learned)",
          "shareUrl": "https://open.spotify.com/episode/3weXhCW5Lmheuya3vMkS4n",
          "date": "2023-07-12T10:30:00Z",
          "description": "We just got back from our very first photography retreat and I can honestly say, my life is changed for the better beause of it.  32 of our alumni from our online course, The Photographers Path met in Maui to fully submerge ourselves into photography. We dove deep into lighting, posing, cameras, lenses and ALL the techy goodness. We were pretty much open books 24/7, sharing and exchanging knowledge, we learned together, grew together, supported each other, and this time we spent together is something Ill honestly never forget. I watched every one of our students push outside their comfort zones and leave this retreat a different person. And it all started with finding the courage to invest in an online photography course, become a part of a loving community, and believe in themselves and their capabilities. Watching each of our students' grow has been the most incredible gift. And on todays podcast episode, Im sharing it all with you! Listen in for:  A recap of our amazing week on Maui  Why TPP alumni are so awesome  The #1 thing all of our students have in common that has catapulted their growth  The 5 most important lessons I learned on this trip and how you can start applying them to your life today!   You're going to want to listen to this episode! SIGN UP FOR THE PHOTOGRAPHER'S PATH WAITLIST DOORS OPEN AUGUST 2023: https://www.horizonfound.com/path GRAB OUR FREE MANUAL MODE CHEAT SHEET: https://resources.horizonfound.com/ FOLLOW US ON INSTAGRAM: https://www.instagram.com/horizonfound JOIN THE HORIZON FOUND COMMUNITY: https://www.facebook.com/groups/477523419716008/ WHAT'S YOUR SECRET PHOTOGRAPHY SUPERPOWER? TAKE THE QUIZ! https://horizonfound.com/quiz  ",
